# Chulpan, Urshaksky Selsoviet, Aurgazinsky District, Republic of Bashkortostan

}}
Chulpan (; , Sulpan) is a rural locality (a village) in Urshaksky Selsoviet, Aurgazinsky District, Bashkortostan, Russia. The population was 45 as of 2010.
Geography
It is located 32&nbsp;km from Tolbazy and 16&nbsp;km from Staroabsalyamovo.
